import React, { useEffect, useState } from "react";
import axios from "axios";
export default function ShowCatogery() {
  var [user] = useState("narayan");
  var [age] = useState(12);
  // var[StateVariable, dispatcher Function]=useState // dispatcherfun
  var [API, setAPI] = useState([]);

  useEffect(() => {
    console.log("Call Category API.");
  });
  axios
    .post("http://localhost:8080/show-Categories")
    .then((result) => {
      console.log(result.data);
      setAPI(result.data); // updating state var using setAPI
    })
    .catch((error) => {
      console.log(error);
    });

  return (
    <div>
      {user}
      {age}
    </div>
  );
}
